/***************************************************************************
//
// Sun
//
// Purpose:
//
//   Computes the Sun's geocentric position using a low precision 
//   analytical series
//
// Input/Output:
//
//   Mjd_TT    Terrestrial Time (Modified Julian Date)
//   SunPos    Solar position [m] with respect to the 
//             mean equator and equinox of J2000 (EME2000, ICRF)
//
****************************************************************************/

void Sun ( const MJDTIME* Mjd_TT, double SunPos[] )
{
	double eps, T;
	double L, M, r;
	double R[9], SunOrb[3];

	T   = ( Mjd_TT->Days + Mjd_TT->FracDay - MJD_J2000 ) / 36525.0; 

	/* Obliquity of J2000 ecliptic */
	eps = 23.43929111 * Rad -( 46.815 + 0.00059*T)*T/Arcs;   

	/* Mean anomaly, ecliptic longitude and radius */

	M = pi2 *  ( 0.9931267 + 99.9973583 * T );                    /* [rad] */
	L = pi2 *  ( 0.7859444 + M/pi2 + 
		(6892.0*sin(M)+72.0*sin(2.0*M)) / 1296.0e3);  /* [rad] */
	r = 149.619e9 - 2.499e9*cos(M) - 0.021e9*cos(2*M);            /* [m] */

	// Equatorial position vector

	Rotation_x( -eps, R );     
	SunOrb[0] = r * cos(L);       /* 黄道坐标 */   
	SunOrb[1] = r * sin(L);
	SunOrb[2] = 0.0;

	MatrixMultiply( 3, 3, 3, 1, R, SunOrb, SunPos );   /* 赤道坐标 */

}

/***************************************************************************
//
// Moon
//
// Purpose:
//
//   Computes the Moon's geocentric position using a low precision
//   analytical series
//
// Input/Output:
//
//   Mjd_TT    Terrestrial Time (Modified Julian Date)
//   MoonPos   Lunar position [m] with respect to the 
//             mean equator and equinox of J2000 (EME2000, ICRF)
//
****************************************************************************/

void Moon ( const MJDTIME* Mjd_TT, double MoonPos[] )
{
	double eps, T;
	double  L_0, l,lp, F, D, dL, S, h, N;
	double  L, B, R, cosB;
	double  Rot[9], MoonOrb[3];

	T   = ( Mjd_TT->Days + Mjd_TT->FracDay - MJD_J2000 ) / 36525.0; 

	/* Obliquity of J2000 ecliptic */
	eps = 23.43929111 * Rad -( 46.815 + 0.00059*T)*T/Arcs;   


	/* Mean elements of lunar orbit */

	L_0 =       ( 0.606433 + 1336.851344*T );     // Mean longitude [rev]
	// w.r.t. J2000 equinox
	l   = pi2 * ( 0.374897 + 1325.552410*T );     // Moon's mean anomaly [rad]
	lp  = pi2 * ( 0.993133 +   99.997361*T );     // Sun's mean anomaly [rad]
	D   = pi2 * ( 0.827361 + 1236.853086*T );     // Diff. long. Moon-Sun [rad]
	F   = pi2 * ( 0.259086 + 1342.227825*T );     // Argument of latitude 


	// Ecliptic longitude (w.r.t. equinox of J2000)

	dL = +22640*sin(l) - 4586*sin(l-2*D) + 2370*sin(2*D) +  769*sin(2*l) 
		-668*sin(lp) - 412*sin(2*F) - 212*sin(2*l-2*D) - 206*sin(l+lp-2*D)
		+192*sin(l+2*D) - 165*sin(lp-2*D) - 125*sin(D) - 110*sin(l+lp)
		+148*sin(l-lp) - 55*sin(2*F-2*D);

	L = pi2 * ( L_0 + dL/1296.0e3 );  // [rad]

	// Ecliptic latitude

	S  = F + (dL+412*sin(2*F)+541*sin(lp)) / Arcs; 
	h  = F-2*D;
	N  = -526*sin(h) + 44*sin(l+h) - 31*sin(-l+h) - 23*sin(lp+h) 
		+11*sin(-lp+h) - 25*sin(-2*l+F) + 21*sin(-l+F);

	B = ( 18520.0*sin(S) + N ) / Arcs;   // [rad]

	cosB = cos(B);

	// Distance [m]

	R = 385000e3 - 20905e3*cos(l) - 3699e3*cos(2*D-l) - 2956e3*cos(2*D)
		-570e3*cos(2*l) + 246e3*cos(2*l-2*D) - 205e3*cos(lp-2*D) 
		-171e3*cos(l+2*D) - 152e3*cos(l+lp-2*D);   

	// Equatorial coordinates

	Rotation_x( -eps, Rot );

	MoonOrb[0] = R * cos(L) * cosB;
	MoonOrb[1] = R * sin(L) * cosB;
	MoonOrb[2] = R * sin(B);

	MatrixMultiply( 3, 3, 3, 1, Rot, MoonOrb, MoonPos );

}

/***************************************************************************
//
// AccelHarmonic
//
// Purpose:
//
//   Computes the acceleration due to the harmonic gravity field of the 
//   central body
//
// Input/Output:
//
//   Pos         Satellite position vector in the inertial system
//   E           Transformation matrix to body-fixed system
//   Para        Parameter of dynamic model 
//   Acc         Acceleration (a=d^2r/dt^2)
//
****************************************************************************/

void AccelHarmonic ( const double Pos[], const double E[9], 
	DYNMODELPARA* Para, double Acc[3] )
{

	int     n,m;                           /* Loop counters */
	double  r_sqr, rho, Fac;               /* Auxiliary quantities  */
	double  x0,y0,z0;                      /* Normalized coordinates */
	double  ax,ay,az;                      /* Acceleration vector  */
	double  C,S;                           /* Gravitational coefficients */
	double  r_bf[3];                       /* Body-fixed position */
	double  a_bf[3];                       /* Body-fixed acceleration */
	double  ET[9];
	double  V[GM_D+2][GM_D+2] = { 0.0 };            /* Harmonic functions */
	double  W[GM_D+2][GM_D+2] = { 0.0 };            /* work array (0..n_max+1,0..n_max+1) */


	/* Body-fixed position  */

	MatrixMultiply( 3, 3, 3, 1, E, Pos, r_bf );

	/* Auxiliary quantities  */

	r_sqr =  VectDot( 3, 3, r_bf, r_bf );        /* Square of distance  */
	rho   =  Para->R_ref * Para->R_ref / r_sqr;

	x0 = Para->R_ref * r_bf[0] / r_sqr;          /* Normalized */
	y0 = Para->R_ref * r_bf[1] / r_sqr;          /* coordinates */
	z0 = Para->R_ref * r_bf[2] / r_sqr;

	/*
	Evaluate harmonic functions 
	V_nm = (R_ref/r)^(n+1) * P_nm(sin(phi)) * cos(m*lambda)
	and 
	W_nm = (R_ref/r)^(n+1) * P_nm(sin(phi)) * sin(m*lambda)
	up to degree and order n_max+1
	*/

	/* Calculate zonal terms V(n,0); set W(n,0)=0.0  */

	V[0][0] = Para->R_ref / sqrt(r_sqr);
	W[0][0] = 0.0;

	V[1][0] = z0 * V[0][0];
	W[1][0] = 0.0;

	for (n=2; n<=Para->n_a+1; n++) 
	{
		V[n][0] = ( (2*n-1) * z0 * V[n-1][0] - (n-1) * rho * V[n-2][0] ) / n;
		W[n][0] = 0.0;
	}

	/* Calculate tesseral and sectorial terms  */

	for (m=1; m<=Para->m_a+1; m++)
	{
		/* Calculate V(m,m) .. V(n_max+1,m)  */

		V[m][m] = (2*m-1) * ( x0*V[m-1][m-1] - y0*W[m-1][m-1] );
		W[m][m] = (2*m-1) * ( x0*W[m-1][m-1] + y0*V[m-1][m-1] );

		if (m <= Para->n_a) 
		{
			V[m+1][m] = (2*m+1) * z0 * V[m][m];
			W[m+1][m] = (2*m+1) * z0 * W[m][m];
		}

		for (n=m+2; n<=Para->n_a+1; n++) 
		{
			V[n][m] = ( (2*n-1)*z0*V[n-1][m] - (n+m-1)*rho*V[n-2][m] ) / (n-m);
			W[n][m] = ( (2*n-1)*z0*W[n-1][m] - (n+m-1)*rho*W[n-2][m] ) / (n-m);
		}
	}

	/* Calculate accelerations ax,ay,az  */

	ax = ay = az = 0.0;

	for (m=0; m<=Para->m_a; m++)
	{
		for (n=m; n<=Para->n_a ; n++)
		{
			if (m==0) 
			{
				C  = CS_JGM3[n][0];   
				ax = ax -  C * V[n+1][1];
				ay = ay-   C * W[n+1][1];
				az = az - (n+1)*C * V[n+1][0];
			}
			else 
			{ 
				C = CS_JGM3[n][m];     /* = C_n,m  */
				S = CS_JGM3[m-1][n];   /* = S_n,m  */

				Fac = 0.5 * (n-m+1) * (n-m+2);
				ax = ax + 0.5 * ( -C*V[n+1][m+1] - S* W[n+1][m+1] )
					+ Fac * ( C*V[n+1][m-1] + S*W[n+1][m-1] );
				ay = ay + 0.5 * ( -C*W[n+1][m+1] + S*V[n+1][m+1] ) 
					+ Fac * ( -C*W[n+1][m-1] + S*V[n+1][m-1] );
				az = az + (n-m+1) * ( -C*V[n+1][m] - S*W[n+1][m]   );
			}
		}
	}

	/* Body-fixed acceleration  */

	a_bf[0] = Para->GM * ax / (Para->R_ref*Para->R_ref);
	a_bf[1] = Para->GM * ay / (Para->R_ref*Para->R_ref);
	a_bf[2] = Para->GM * az / (Para->R_ref*Para->R_ref);

	/* Inertial acceleration */
	MatrixTranspose( 3, 3, E, ET );
	MatrixMultiply( 3, 3, 3, 1, ET, a_bf, Acc );

}

/***************************************************************************
//
// AccelPointMass
//
// Purpose:
//
//   Computes the perturbational acceleration due to a point mass such as Sun 
and Moon
//
// Input/Output:
//
//   Pos         Satellite position vector (r)
//   S           Point mass position vector (s)
//   GM          Gravitational coefficient of point mass
//   Acc         Acceleration (a=d^2r/dt^2)
//
****************************************************************************/

void AccelPointMass (const double Pos[3], const double S[], 
	double GM, double Acc[3] )
{
	int i;
	double d[3]; /* Relative position vector of satellite w.r.t. point mass */
	double Rd, Rs;

	MatrixSubstract( 3, 1, Pos, S, d );

	Rd = VectDot( 3, 3, d, d );
	Rd = sqrt( Rd );

	Rs = VectDot( 3, 3, S, S );
	Rs = sqrt( Rs );

	for( i=0; i<3; i++ )
	{
		Acc[i] = (-GM) * ( d[i]/pow(Rd,3) + S[i]/pow(Rs,3) );
	}

}

/***************************************************************************
//
// AccelEarthTides
// 
//   Computer the perturbational acceleration due to solid earth tide.
//
//   Input/Output
//
//   Pos         Spacecraft position[m] 
//   SunPos      Sun position vector[m] 
//   MoonPos     Moon position vector[m] 
//   Acc         Acceleration (a=d^2r/dt^2)
****************************************************************************/

void AccelEarthTides( const double Pos[3], const double SunPos[3],
	const double MoonPos[3], double Acc[3])
{
	int i;
	double RSun, RMoon, RSat;
	double cosSun, cosMoon;
	double T5;

	RSun = VectDot( 3, 3, SunPos, SunPos );
	RSun = sqrt( RSun );

	RMoon = VectDot( 3, 3, MoonPos, MoonPos );
	RMoon = sqrt( RMoon );

	RSat = VectDot( 3, 3, Pos, Pos );
	RSat = sqrt( RSat );

	cosSun = VectDot( 3, 3, Pos, SunPos ); /*太阳、卫星的地心夹角*/
	cosSun = cosSun / RSat / RSun;
	cosMoon = VectDot( 3, 3, Pos, MoonPos );
	cosMoon = cosMoon / RSat / RMoon;
	T5      = pow(R_Earth,5)/pow(RSat,4);

	for( i=0; i<3; i++ )
	{
		Acc[i] = 0.15 * ( GM_Sun/pow(RSun,3) * T5 * ((3.0-15.0*cosSun*cosSun)
			*Pos[i]/RSat + 6.0*cosSun * SunPos[i]/RSun ))
			+ 0.15 * ( GM_Moon/pow(RMoon,3) * T5 * ((3.0-15.0*cosMoon*cosMoon)
			*Pos[i]/RSat + 6.0*cosMoon * MoonPos[i]/RMoon ));
	}
}

/***************************************************************************
//
// AccelDrag
//
// Purpose:
//
//   Computes the acceleration due to the atmospheric drag.
//
// Input/Output:
//
//   Mjd_TT      Terrestrial Time (Modified Julian Date)
//   T           Transformation matrix to true-of-date inertial system
//   Pos         Satellite position vector in the inertial system [m]
//   Vel         Satellite velocity vector in the inertial system [m/s]
//   Para        Parameter of dynamic model 
//   Acc         Acceleration (a=d^2r/dt^2) [m/s^2]
//
****************************************************************************/

void AccelDrag ( const MJDTIME* Mjd_TT, const double T[9], 
	const double Pos[3], const double Vel[3], 
	DYNMODELPARA* Para, double Acc[3] )
{
	int i;
	double v_abs, dens;
	double r_tod[3], v_tod[3];
	double v_rel[3], a_tod[3];
	double T_trp[9];    /* Transformation matrix to ICRF/EME2000 system */

	MatrixTranspose( 3, 3, T, T_trp );

	/* Position and velocity in true-of-date system */

	MatrixMultiply( 3, 3, 3, 1, T, Pos, r_tod );
	MatrixMultiply( 3, 3, 3, 1, T, Vel, v_tod );

	/* Velocity relative to the Earth's atmosphere */

	v_rel[0] = v_tod[0] + Omega_WGS * r_tod[1];
	v_rel[1] = v_tod[1] - Omega_WGS * r_tod[0];
	v_rel[2] = v_tod[2];

	v_abs = sqrt( VectDot( 3, 3, v_rel, v_rel ));

	/* Atmospheric density due to modified Harris-Priester model */

	dens = Density_HP (Mjd_TT,r_tod);

	v_abs = -0.5 * Para->Cd * ( Para->Area_H/Para->Mass ) * dens * v_abs;

	for( i=0; i<3; i++ )
	{
		a_tod[i] = v_abs * v_rel[i];
	}

	MatrixMultiply( 3, 3, 3, 1, T_trp, a_tod, Acc );

}

/***************************************************************************
//
// Density_HP
//
// Purpose:
//
//   Computes the atmospheric density for the modified Harris-Priester model.
//
// Input/Output:
//
//   Mjd_TT      Terrestrial Time (Modified Julian Date)
//   Pos         Satellite position vector in the inertial system [m]
//   <return>    Density [kg/m^3]
//
****************************************************************************/

double Density_HP ( const MJDTIME* Mjd_TT, const double Pos[3] )
{
	const double upper_limit =   1000.0;        // Upper height limit [km]
	const double lower_limit =    100.0;        // Lower height limit [km]
	const double ra_lag      = 0.523599;        // Right ascension lag [rad]
	const int    n_prm       =        6;        // Harris-Priester parameter 
	// 2(6) low(high) inclination
	int    i, ih;                               // Height section variables        
	double height;                              // Earth flattening
	double dec_Sun, ra_Sun, c_dec;              // Sun declination, right asc.
	double c_psi2;                              // Harris-Priester modification
	double density, h_min, h_max, d_min, d_max; // Height, density parameters
	double r_Sun[3];                            // Sun position
	double u[3];                                // Apex of diurnal bulge
	double Blh[3];

	// Harris-Priester atmospheric density model parameters 
	// Height [km], minimum density, maximum density [gm/km^3]

	const int    N_Coef = 50;
	const double Data_h[N_Coef]= {
		100.0, 120.0, 130.0, 140.0, 150.0, 160.0, 170.0, 180.0, 190.0, 200.0,     
		210.0, 220.0, 230.0, 240.0, 250.0, 260.0, 270.0, 280.0, 290.0, 300.0,     
		320.0, 340.0, 360.0, 380.0, 400.0, 420.0, 440.0, 460.0, 480.0, 500.0,     
		520.0, 540.0, 560.0, 580.0, 600.0, 620.0, 640.0, 660.0, 680.0, 700.0,     
		720.0, 740.0, 760.0, 780.0, 800.0, 840.0, 880.0, 920.0, 960.0,1000.0};    
		const double Data_c_min[N_Coef] = {
			4.974e+05, 2.490e+04, 8.377e+03, 3.899e+03, 2.122e+03, 1.263e+03,         
			8.008e+02, 5.283e+02, 3.617e+02, 2.557e+02, 1.839e+02, 1.341e+02,         
			9.949e+01, 7.488e+01, 5.709e+01, 4.403e+01, 3.430e+01, 2.697e+01,         
			2.139e+01, 1.708e+01, 1.099e+01, 7.214e+00, 4.824e+00, 3.274e+00,         
			2.249e+00, 1.558e+00, 1.091e+00, 7.701e-01, 5.474e-01, 3.916e-01,         
			2.819e-01, 2.042e-01, 1.488e-01, 1.092e-01, 8.070e-02, 6.012e-02,         
			4.519e-02, 3.430e-02, 2.632e-02, 2.043e-02, 1.607e-02, 1.281e-02,         
			1.036e-02, 8.496e-03, 7.069e-03, 4.680e-03, 3.200e-03, 2.210e-03,         
			1.560e-03, 1.150e-03                                            };        
			const double Data_c_max[N_Coef] = {
				4.974e+05, 2.490e+04, 8.710e+03, 4.059e+03, 2.215e+03, 1.344e+03,         
				8.758e+02, 6.010e+02, 4.297e+02, 3.162e+02, 2.396e+02, 1.853e+02,         
				1.455e+02, 1.157e+02, 9.308e+01, 7.555e+01, 6.182e+01, 5.095e+01,         
				4.226e+01, 3.526e+01, 2.511e+01, 1.819e+01, 1.337e+01, 9.955e+00,         
				7.492e+00, 5.684e+00, 4.355e+00, 3.362e+00, 2.612e+00, 2.042e+00,         
				1.605e+00, 1.267e+00, 1.005e+00, 7.997e-01, 6.390e-01, 5.123e-01,         
				4.121e-01, 3.325e-01, 2.691e-01, 2.185e-01, 1.779e-01, 1.452e-01,         
				1.190e-01, 9.776e-02, 8.059e-02, 5.741e-02, 4.210e-02, 3.130e-02,         
				2.360e-02, 1.810e-02                                            };        

				XYZToBLH( Pos, Blh, R_WGS84, F_WGS84 );

				height = Blh[2]/1000.0;     /* Satellite height  [km] */

				/* Exit with zero density outside height model limits */
				if ( height >= upper_limit || height <= lower_limit ) 
				{
					return 0.0;
				}

				// Sun right ascension, declination

				Sun( Mjd_TT, r_Sun );
				ra_Sun  = atan2( r_Sun[1], r_Sun[0] ); 
				dec_Sun = atan2( r_Sun[2], sqrt( pow(r_Sun[0],2)+pow(r_Sun[1],2) ) );


				/* Unit vector u towards the apex of the diurnal bulge
				in inertial geocentric coordinates  */

				c_dec = cos(dec_Sun);
				u[0] = c_dec * cos(ra_Sun + ra_lag);
				u[1] = c_dec * sin(ra_Sun + ra_lag);
				u[2] = sin(dec_Sun);


				/* Cosine of half angle between satellite position vector and
				apex of diurnal bulge */

				c_psi2 = 0.5 + 0.5 * VectDot( 3, 3, Pos, u)
					/sqrt( VectDot( 3, 3, Pos, Pos ) );

				/* Height index search and exponential density interpolation */

				ih = 0;                           
				for ( i=0; i<=N_Coef-1; i++)      
				{
					if ( height >= Data_h[i] && height < Data_h[i+1] ) 
					{
						ih = i;      
						break;
					}
				}

				h_min = (Data_h[ih] - Data_h[ih+1])/log( Data_c_min[ih+1]/Data_c_min[ih]);
				h_max = (Data_h[ih] - Data_h[ih+1])/log( Data_c_max[ih+1]/Data_c_max[ih]);

				d_min = Data_c_min[ih] * exp( (Data_h[ih]-height)/h_min );
				d_max = Data_c_max[ih] * exp( (Data_h[ih]-height)/h_max );

				density = d_min + (d_max-d_min)*pow(c_psi2,n_prm/2);  /* Density computation */

				return ( density * 1.0e-12 );  

}

/***************************************************************************
//
// AccelSolrad
//
// Purpose:
//
//   Computes the acceleration due to solar radiation pressure assuming 
//   the spacecraft surface normal to the Sun direction
//
// Input/Output:
//
//   SatPos         Satellite position vector in the inertial system [m]
SunPos         Sun position vector in the inertial system[m]
//   Para           Parameter of dynamic model 
//   Acc            Acceleration (a=d^2r/dt^2) [m/s^2]
//
****************************************************************************/

void AccelSolrad ( const double SatPos[3], const double SunPos[3],
	DYNMODELPARA* Para, double Acc[3])
{
	int i;
	double d[3], Normd;   
	double e_Sun[3], NormSun, s;

	NormSun = sqrt( VectDot( 3, 3, SunPos, SunPos ) );
	for( i=0; i<3; i++ )
	{
		d[i] = SatPos[i] - SunPos[i];
		e_Sun[i] = SunPos[i] / NormSun;
	}

	s     = VectDot( 3, 3, SatPos, e_Sun );     

	for( i=0; i<3; i++ )
	{
		e_Sun[i] = SatPos[i] - s * e_Sun[i];
	}
	NormSun = sqrt( VectDot( 3, 3, e_Sun, e_Sun ) );

	if( (s>0) || (NormSun > R_Earth) )   /* 蚀因子计算 */
	{
		Normd = VectDot( 3, 3, d, d );

		for( i=0; i<3; i++ ) 
		{
			Acc[i] = Para->Cr * Para->Area_R * P_Sol * AU * AU *
				d[i] / Para->Mass / pow( Normd, 1.5 );
		}
	}
	else
	{
		for( i=0; i<3; i++ )
		{
			Acc[i] = 0.0;
		}
	}
}

/***************************************************************************
//
// AccelMain
//
// Purpose:
//
//   Computes the acceleration of an Earth orbiting satellite due to 
//    - the Earth's harmonic gravity field, 
//    - the gravitational perturbations of the Sun and Moon
//    - the solid earth tide and
//    - the atmospheric drag
//
// Input/Output:
//
//   Mjd_TT      Terrestrial Time (Modified Julian Date)
//   Pos         Satellite position vector in the ICRF/EME2000 system
//   Vel         Satellite velocity vector in the ICRF/EME2000 system
//   E           Transformation matrix to body-fixed system
//   T           Transformation matrix to true-of-date inertial system
//   Para        Parameter of dynamic model 
//   Acc         Acceleration (a=d^2r/dt^2) in the ICRF/EME2000 system
//
****************************************************************************/

void AccelMain( int graceType, const MJDTIME* Mjd_TT, const double Pos[3], const double Vel[3],
	const double E[9], const double T[9],
	DYNMODELPARA* Para, double Accel[3] )
{
	int i;
	double a[3], r_Sun[3], r_Moon[3];
	FILE * accFile;
	char	fileName[60]="";


	AccelHarmonic( Pos, E, Para, a );
	for( i=0; i<3; i++ )
	{
		Accel[i] = a[i];
	}


	Sun(  Mjd_TT, r_Sun );
	Moon( Mjd_TT, r_Moon );

	AccelPointMass( Pos, r_Sun, GM_Sun, a );
	for( i=0; i<3; i++ )
	{
		Accel[i] = Accel[i] + a[i];
	}



	AccelPointMass( Pos, r_Moon, GM_Moon, a );
	for( i=0; i<3; i++ )
	{
		Accel[i] = Accel[i] + a[i];
	}
	
	AccelEarthTides( Pos, r_Sun, r_Moon, a );
	for( i=0; i<3; i++ )
	{
		Accel[i] = Accel[i] + a[i];
	}
	/*
	AccelDrag( Mjd_TT, T, Pos, Vel, Para, a );
	for( i=0; i<3; i++ )
	{
		Accel[i] = Accel[i] + a[i];
	}

	AccelSolrad( Pos, r_Sun, Para, a );
	for( i=0; i<3; i++ )
	{
		Accel[i] = Accel[i] + a[i];
	}
	*/
}

/***************************************************************************
//
// Gradient
//
// Purpose:
//
//   Computes the gradient of the Earth's harmonic gravity field 
//
// Input/Output:
//
//   Mjd_UT      Modified Julian Date (Universal Time)
//   E           Transformation matrix to body-fixed system
//   Pos         Satellite position vector in the ICRF/EME2000 system
//   Para        Parameter of dynamic model 
//   Grad        da/dr
//
****************************************************************************/

void Gradient ( const MJDTIME* Mjd_TT, const double E[9], const double Pos[3],
	DYNMODELPARA* Para, double Grad[9] )

{
	int     i, j;
	int     m, n;
	double  a0[3], a1[3], r[3];
	double  d = 1.0;   // Position increment [m]

	m = Para->m_a;
	n = Para->n_a;

	Para->n_a = 2;  /* 只考虑J2项影响 */
	Para->m_a = 0;

	for (i=0; i<=2; i++)
	{
		for( j=0; j<3; j++ )
		{
			r[j] = Pos[j];
		}
		r[i] = Pos[i] + d/2.0;   /* 改变一个坐标分量, 其它不变, 计算地球引力加速度*/

		AccelHarmonic( r, E, Para, a0 );

		r[i] = Pos[i] - d/2.0;
		AccelHarmonic( r, E, Para, a1 );

		for( j=0; j<3; j++ )
		{
			/* 差商近似法计算地球引力加速度梯度 */
			*(Grad + j*3 +i) = ( a0[j] - a1[j] ) / d;
		}
	}

	Para->m_a = m;
	Para->n_a = n;

}

